import React from "react";
import Wrapper from '../components/Header/Wrapper';
import styled from 'styled-components';

import BachelorsDoc from "../components/Room/Docs/BachelorsDoc.jsx";
import MastersDoc from "../components/Room/Docs/MastersDoc.jsx";
import GACertDoc from "../components/Room/Docs/GACertDoc.jsx";
import GrandCanyon from "../components/Room/UploadPhotosToWeb/docs/grandCanyon.png";

// const EducationPageStyled = styled.div;

const EducationPage=() => {
    return(
        <section id="educationPage">
            <Wrapper>
            <div className="educationContainer">
                {/* svg line is the filled space */}
                <svg preserveAspectRatio="xMidYMid meet" viewbox="0 0 100 90" width="100" height="90">
                    <defs>
                        <mask id="mask" x="0" y="0" width="95%" height="90%">
                        <rect x="0" y="0" width="100%" height="100%" fill="#fff"/>


                        <text className="edFloatText" x="100" text-anchor="middle" y="375" dy="0">E</text>
                        <text className="edFloatText" x="215"  text-anchor="middle" y="375" dy="0">D</text>
                        <text className="edFloatText" x="330" text-anchor="middle" y="375" dy="0">U</text>
                        <text className="edFloatText" x="445" text-anchor="middle" y="375" dy="0">C</text>
                        <text className="edFloatText" x="560" text-anchor="middle" y="375" dy="0">A</text>
                        <text className="edFloatText" x="675" text-anchor="middle" y="375" dy="0">T</text>
                        <text className="edFloatText" x="790" text-anchor="middle" y="375" dy="0">I</text>
                        <text className="edFloatText" x="905" text-anchor="middle" y="375" dy="0">O</text>
                        <text className="edFloatText" x="1010" text-anchor="middle" y="375" dy="0">N</text>


                        </mask>
                    </defs>
                    {/* Frame */}
                    <rect x="30" y="30" width="100%" height="100%" mask="url(#mask)" fill-opacity="1" fill="#fff"/>
                </svg>
            </div>

                <div className="redbox">
                    <img src={GrandCanyon} alt="" id="grandCanyonImg" className="thematicImg responsive-img"/>
                </div>
                {<MastersDoc/>}
                {<BachelorsDoc/>}
                {<GACertDoc/>}
            </Wrapper>
        </section>
    )
}

export default EducationPage;
